      image3: "3.png",
      image4: "4.png",
    },

    {
      image1: "1.png",
      image2: "2.png",
      image3: "3.png",
      image4: "4.png",
    },
  ];

  return (
    <>
      <Grid
        container
        style={{
          position: "relative",
        }}
      >
        {images.map((image: any, i: number) => {
          console.log(image.ikmage1);
        })}
      </Grid>
    </>
  );
}

export default Profile;
